import Product from './Images/Product.png';
import './App.css';
import { Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={Product} className="App-logo" alt="logo" />
        <p className="m-3">
          Product 101
        </p>
        <Link to="/dashboard">
        <button className="button-primary">
          Dive in!
        </button>
        </Link>
      </header>
    </div>
  );
}

export default App;
